def a(n):
  if n == 1:
    return 1
  tot,c,k = 0,0,0
  for x in range(1,10**7):
    tot += 1/x
    if tot >= 0.5:
      k += 1
      tot = 0
    if k == n-1:
      c += 1
    if k == n:
      return c
n = 1
while n < 100:
  print(a(n),end=', ')
  n += 1
